DROP TABLE IF EXISTS `p_images`;
CREATE TABLE `p_images` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `image` varchar(200) NOT NULL DEFAULT '' COMMENT '图片',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0 待审核 1 审核通过 2 审核未通过',
  `message` varchar(500) DEFAULT NULL COMMENT '审核拒绝原因',
  `like_num` int(11) NOT NULL DEFAULT '0' COMMENT '点赞数',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1696 DEFAULT CHARSET=utf8mb4 COMMENT='图片表';

