DROP TABLE IF EXISTS `p_users`;
CREATE TABLE `p_users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `openid` varchar(64) NOT NULL DEFAULT '' COMMENT '微信open_id',
  `unionid` varchar(64) NOT NULL DEFAULT '' COMMENT '微信unionid',
  `nickname` varchar(200) NOT NULL DEFAULT '' COMMENT '昵称',
  `username` varchar(200) NOT NULL DEFAULT '' COMMENT '用户名',
  `mobile` char(15) NOT NULL DEFAULT '' COMMENT '用户手机',
  `password` varchar(200) NOT NULL DEFAULT '' COMMENT '密码',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '用户状态',
  `birthday` date NOT NULL DEFAULT '1000-01-01' COMMENT '生日',
  `sex` tinyint(3) unsigned NOT NULL DEFAULT '2' COMMENT '性别， 0:女,1:男  2：保密',
  `qq` varchar(15) NOT NULL DEFAULT '' COMMENT 'QQ',
  `email` varchar(50) NOT NULL DEFAULT '' COMMENT '邮箱',
  `avatar` varchar(500) DEFAULT NULL COMMENT '头像',
  `subscribe` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '是否关注 1关注 2 未关注',
  `subscribe_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '关注时间',
  `logged_ip` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '最后登录IP',
  `logged_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后登录时间',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `deleted_at` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `idx_nickname` (`nickname`(191))
) ENGINE=InnoDB AUTO_INCREMENT=5330 DEFAULT CHARSET=utf8mb4 COMMENT='用户表';

